JOIN THE FAST &amp; FURIOUS 6 CREW
Take down a crew of lethally skilled mercenary drivers to earn respect as you drift and drag through the streets of London.

SHOW OFF YOUR STYLE
Collect, customize and upgrade a variety of high end licensed cars including hero cars from the movie Fast &amp; Furious 6 - all featuring stunning graphics.

PULL OFF ONE LAST JOB
Earn gold and coins by pulling thrilling heists with the Fast &amp; Furious 6 crew and hero cars.

COMPETE
Rule tournaments, race online, or join a crew and take on the world by dominating the global leaderboards.

HD QUALITY
1080p for hi-def gaming experience on most Android tablets.

